import React, { useEffect, useState } from 'react';
import './ProfileOverview.css';
import profilePic from '../assets/icons/pp.png';
import verifiedIcon from '../assets/icons/blue-tick.png';
import notifIcon from '../assets/icons/notif-icon.png';
import applicationIcon from '../assets/icons/application-icon.png';
import evalIcon from '../assets/icons/eval-icon.png';

const ProfileOverview = () => {
  // simulate loading animation
  const [loaded, setLoaded] = useState(false);
  useEffect(() => {
    const t = setTimeout(() => setLoaded(true), 100);
    return () => clearTimeout(t);
  }, []);

  const user = {
    name: 'Yahia Hesham',
    major: 'Computer Engineering & Tech',
    status: 'pro',
    completedMonths: 5,
    totalMonths: 6,
    profileUrl: '/profile',
    cycle: {
      state: 'Active',
      start: 'March 1, 2025',
      end: 'June 1, 2025'
    }
  };

  const pct = Math.round((user.completedMonths / user.totalMonths) * 100);

  return (
    <div className={`profile-overview ${loaded ? 'entered' : ''}`}>
      <a href={user.profileUrl} className="profile-header">
        <img src={profilePic} alt="Profile" className="profile-img" />
        <div className="name-status">
          <h2>{user.name}</h2>
          {user.status === 'pro' && (
            <img src={verifiedIcon} alt="Verified" className="verified-icon" />
          )}
        </div>
      </a>

      <div className="progress-bar">
        <div className="progress-fill" style={{ width: `${pct}%` }} />
      </div>
      <p className="progress-label">
        {user.completedMonths} of {user.totalMonths} months completed
      </p>

      <div className="cycle-info">
        <h4>Internship Cycle</h4>
        <p className="cycle-status">{user.cycle.state}</p>
        <p className="cycle-dates">
          {user.cycle.start} &rarr; {user.cycle.end}
        </p>
      </div>

      <div className="profile-nav-buttons">
        <button className="nav-button">
          <img src={notifIcon} alt="Notifications" />
          <span>Notifications</span>
        </button>
        <button className="nav-button">
          <img src={applicationIcon} alt="Applications" />
          <span>Applications</span>
        </button>
        <button className="nav-button">
          <img src={evalIcon} alt="Evaluations" />
          <span>Evaluations</span>
        </button>
      </div>
    </div>
  );
};

export default ProfileOverview;
